/*Part (A) : Marketing*/
/*1. Rewarding Most Loyal Users: People who have been using the platform for the longest time.
Finding the 5 oldest users of the Instagram from the database provided*/
select username, created_at from users
order by created_at ASC limit 5;

/*2. Remind Inactive Users to Start Posting: By sending them promotional emails to post their 1st photo.
Find the users who have never posted a single photo on Instagram*/

select username, users.id as user_id
from users
left join photos
on users.id = photos.user_id
where photos.id IS NULL
order by users.id;


select user_id, created_dat
from photos
where created_dat != NULL;

table users; table photos;

select count(distinct(users.id))
from users;

select count(distinct(photos.user_id))
from photos;

/*3. Declaring Contest Winner: The team started a contest and the user who gets the most likes on a single photo will win the contest now they wish to declare the winner.
Identify the winner of the contest and provide their details to the team*/

select users.id as user_id, users.username, photos.id as photo_id, photos.image_url, count(*) as total
from photos
inner join likes
on likes.photo_id = photos.id
inner join users
on photos.user_id = users.id
group by photos.id
order by total DESC
limit 1;

select users.id as user_id, users.username, photos.id as photo_id, photos.image_url, count(*) as total
from photos
inner join likes
on likes.photo_id = photos.id
inner join users
on photos.user_id = users.id
group by photos.id
order by total DESC;

table likes;
table photos;
table tags;
table photo_tags;

/*4. Hashtag Researching: A partner brand wants to know, which hashtags to use in the post to reach the most people on the platform.
Identify and suggest the top 5 most commonly used hashtags on the platform*/
select tags.tag_name, count(*) as total_number_of_times_tag_used_individually 
from tags
join photo_tags
on tags.id = photo_tags.tag_id
group by tags.tag_name
order by total_number_of_times_tag_used_individually DESC
limit 5;

select count(tag_id)
from photo_tags
join tags
on tags.id = photo_tags.tag_id
where tags.tag_name = 'smile';

/*5. Launch AD Campaign: The team wants to know, which day would be the best day to launch ADs.
What day of the week do most users register on? Provide insights on when to schedule an ad campaign*/
select dayname(created_at) as day_of_week, count(*) as total_number_of_users_registered 
from users
group by day_of_week
order by total_number_of_users_registered DESC;

/*Part B: Investor Metrics*/
/*1. User Engagement: Are users still as active and post on Instagram or they are making fewer posts
Provide how many times does average user posts on Instagram.
Also, provide the total number of photos on Instagram/total number of users*/

select (select count(*) from users), (select count(*) from photos);

select (select count(*) from users)/(select count(*) from photos);

select user_id,count(*) as user_post_count from photos group by user_id order by user_id;

select (select count(*) from photos)/(select count(*) from users) as total_photos_divide_total_photos;

select (select avg(id) from photos)/(select avg(id) from users) as avg_posts_user;

select user_id,round((sum(id)/257),0) as avg_users_posts
from photos
group by user_id;

select user_id ,id, (sum(id)/count(id)) as a
from photos
group by user_id;


SELECT
(
	(SELECT COUNT(*) FROM photos) /
	(SELECT COUNT(*) FROM users)
) AS avg_posts;

table photos;

select distinct user_id,  (sum(user_id)-count(user_id)) as times_avg_user_posts
from photos
group by user_id;

select user_id, (sum(user_id)/ 257) as avg_users_posts
from photos
group by user_id;

select user_id, round(((sum(user_id))/ 257),0) as avg_users_posts
from photos
group by user_id;


/*2.Bots & Fake Accounts: The investors want to know if the platform is crowded with fake and dummy accounts
Provide data on users (bots) who have liked every single photo on the site 
(since any normal user would not be able to do this).*/
select user_id, username, count(*) as total_likes_per_user
from users
inner join likes
on users.id = likes.user_id
group by likes.user_id
having total_likes_per_user = (select count(*) from photos);
